const ArticleList = ({articleList}) => {
// console.log(articleList);
    return (
        <div>
            <ul>
            {/* <li className="articleWrap">
                                <div className="articleTitle">asda</div>
                                <div className="articleTxt">asdad</div>
                            </li> */}
                {
                    articleList.map(article => {
                        return (
                            <li className="articleWrap">
                                <div className="articleTitle">{article.title}</div>
                                <div className="articleTxt">{article.summary}</div>
                            </li>
                        )
                    })
                }
            </ul>
            <style jsx>
                {`
                    .articleWrap{
                        margin:0 0 30px 0;
                    }
                    .articleTitle{
                        color: #333333;
                        font-size: 18px;
                        line-height: 30px;
                        cursor: pointer;
                    }
                    .articleTxt{
                        font-size: 14px;
                        color: #999999;
                        line-height: 30px;
                        cursor: pointer;
                    }
                `}
            </style>
        </div>
    )
}

export default ArticleList;
